import React, { useEffect, useState } from 'react';
import { getWisata, deleteWisata } from '../../api';  // Pastikan deleteWisata di-import
import BackButton from '../admin/BackButton';
import { useNavigate } from 'react-router-dom';

const ManajemenWisata = () => {
    const [wisataList, setWisataList] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        fetchWisata();
    }, []);

    const fetchWisata = async () => {
        const data = await getWisata();
        setWisataList(data);
    };

    const handleDelete = async (id) => {
        if (window.confirm("Apakah Anda yakin ingin menghapus data ini?")) {
            try {
                await deleteWisata(id);
                fetchWisata();  // Refresh daftar wisata setelah dihapus
                alert("Data wisata berhasil dihapus!");
            } catch (error) {
                alert("Gagal menghapus data wisata.");
            }
        }
    };

    return (
        <div className="admin-container">
            <BackButton />
            <h2>Manajemen Wisata</h2>
            <table className="admin-table">
                <thead>
                    <tr>
                        <th>No</th>
                        <th>Nama Wisata</th>
                        <th>Aksi</th>
                    </tr>
                </thead>
                <tbody>
                    {wisataList.map((wisata, index) => (
                        <tr key={wisata.id}>
                            <td>{index + 1}</td>
                            <td>{wisata.nama}</td>
                            <td>
                                <button onClick={() => navigate(`/admin/edit-wisata/${wisata.id}`)}>Edit</button>
                                <button className="btn-delete" onClick={() => handleDelete(wisata.id)}>Hapus</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ManajemenWisata;
